import './home.css';
import '../button/invButton.js'
import InvButton from '../button/invButton.js';

function Home () {

    return (
        <div>

        {/* Next Generation Wrapper  */}
        
        <section class="wrapper1">
           <div class="wrapper1-texts">
              <h1>Next generation digital banking</h1>
              <p>Take your financial life online. Your Easybank account will be a one-stop-shop 
            for spending, saving, budgeting, investing, and much more.</p>
            <InvButton />
           </div>

           <div class="wrapper1-background">
               <img class="phones-background" src="../../assets/images/bg-intro-desktop.svg" alt="easybank"></img>
               <img class="phones-image" src="../../assets/images/image-mockups.png" alt="easybank"></img>
           </div>
        </section>




        </div>
    );

}


export default Home;
